import React from 'react';
import { Routes, Route } from 'react-router-dom';
import MainPage from './com/Mainpage';
import Login from './com/Login'; 

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<MainPage />} />
      <Route path="/login" element={<Login />} /> {/* 로그인 페이지 라우트 추가 */}
    </Routes>
  );
};

export default App;
